sq--src-components-image-js.query:
query usersJoshSandboxGatsbyMyawesomeportfolioSrcComponentsImageJs2011440971 {
  placeholderImage: file(relativePath: {eq: "gatsby-astronaut.png"}) {
    childImageSharp {
      fluid(maxWidth: 300) {
        ...GatsbyImageSharpFluid
      }
    }
  }
}

fragment GatsbyImageSharpFluid on ImageSharpFluid {
  base64
  aspectRatio
  src
  srcSet
  sizes
}

sq--src-components-main-menu-js.query:
query usersJoshSandboxGatsbyMyawesomeportfolioSrcComponentsMainMenuJs3391994375 {
  allWordpressWpApiMenusMenusItems(filter: {name: {eq: "Main menu"}}) {
    edges {
      node {
        name
        items {
          title
          object_slug
        }
      }
    }
  }
}

sq--src-components-site-info-js.query:
